import React from "react";
// import logo from "./logo.svg";
import "./App.css";
import Title from "./title";
import Unittype from "./unittype";
// import Firtunit from "./firstInput";
import Secoundunit from "./secoundInput";

function App() {
  return (
    <body>
      <div className="box">
        <Title></Title>
        <Unittype></Unittype>
        <Firtunit></Firtunit>
        <Firtunit></Firtunit>
        {/* <Secoundunit></Secoundunit> */}
      </div>
    </body>
  );
}

export default App;
